import React from 'react';
import './publications.css';
import { Container, Row, Col } from 'reactstrap';

class Publications extends React.Component{
    render(){
        return(
            <div>
                <Container>
                    <Row><br /><br /></Row>
                    Publications
                </Container>
            </div>
        )
    }
}


export default Publications;
